function Car({ information }) {
  const [detail, setDetail] = useState(false);
  return (
    <div className="w-full my-[30vh]">

        <div
          className="hover:p-[15%] hover:duration-500"
          onMouseOver={setDetail(true)}
        >
          <div>
            <div>{information.id}</div>
            <div>{information.carName}</div>
            <div>{information.carPrice}</div>
          </div>
          <div>
            {information.images.map((item, index) => {
              return (
                <div key={index}>
                  <img src={item[index]} alt={"*Maybe API problem*"} />
                </div>
              );
            })}
          </div>
        </div>
      </div>
  );
}

export default Car;
